package com.we.member;

public class data {
	private String name;
	private int price;
	
	public data() {
		// TODO Auto-generated constructor stub
	}

	public data(String name, int price) {
		super();
		this.name = name;
		this.price = price;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public int getPrice() {
		return price;
	}

	public void setPrice(int price) {
		this.price = price;
	}
	
	
	
}
